import React from 'react';
import { Routes, Route } from 'react-router-dom';

import Home from './components/Home';
import Characters from './Characters';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/characters" element={<Characters />} />
    </Routes>
  );
}

export default App;
